import React from 'react'

function ProductList(props) {
    const productList = props.productList.map((product)=>{
    <h2>{product}</h2>
    })
    console.log(productList)
    return (
        <div>
            <h2>{productList}</h2>
        </div>
    )
}

export default ProductList
